import styled from "@emotion/styled";
export const TodayGraph = styled.div`
  width: 64%;
  border-left: 0.2rem solid black;
  border-bottom: 0.2rem solid black;
  padding-top: 32rem;
  padding-right: 9.7rem;
`;
